const filterDucksEvent = (event) => {
    const buttonID = event.target.id;
    const tempPetCollection = [];
  
    if (buttonID === 'all') {
      buildDuckCards(ducks);
      return;
    }

    for (let i = 0; i < ducks.length; i++) {
        if ('isRubber' === buttonID && ducks[i].isRubber) {
            tempPetCollection.push(ducks[i]);
        }else if (('isNotRubber' === buttonID && ducks[i].isRubber === false)){
            tempPetCollection.push(ducks[i]);
        }
    }
    buildDuckCards(tempPetCollection);        
}
  
const clickEvents = () => {
    document.querySelector('#all').addEventListener('click', filterDucksEvent);
    document.querySelector('#isRubber').addEventListener('click', filterDucksEvent);
    document.querySelector('#isNotRubber').addEventListener('click', filterDucksEvent);
}
  
 
const init = () => {
    buildDuckCards(ducks);
    clickEvents();  
}
  
init();


